import React from "react";
import "./Login.css";

const Login = () => {
  return (
    <>
      <form>
        <label for="email">email</label>
        <input
          type="email"
          placeholder="youremail@gmail.com"
          id="email"
          name="email"
        />
      </form>
    </>
  );
};

export default Login;
